const link = "../../productIMGS/"
const fotosCompiler = (props) => {
    let fotos = []
    console.log([...props])
    return fotos
}
const initialState = {
    products : {
        accessories : {
            men: [{
                itemID: "1",
                name: "chain",
                mainFoto: require(`../../productIMGS/ID_1/main.webp`),
                fotos: fotosCompiler(1,2)

            }],
            woman : [],
            kids: [],
        },
        bags : {
            men: [],
            woman : [],
            kids: [],
        },
        denim : {
            men: [],
            woman : [],
            kids: [],
        },
        "t-shirts" : {
            men: [],
            woman : [],
            kids: [],
        }
    }


}
export const productsReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
